import React from 'react';
import styled from 'styled-components';

const LifeCell = styled.div`
  border: .5px solid red;
  background-color: black; 
  width: 10px;
  height: 10px;
`;

/*
  should be a way to access passed 'isAlive' boolean value and use for
  conditional color rendering of cell styled component background color
*/

const Cell = props => {
  return(
    <LifeCell />
  );
}

export default Cell;
